import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container">
      <header>
        <h1>ROLODEX</h1>
      </header>
      <h2>My Profiles</h2>
      <div className="profiles-grid">
        <div className="profile-box pink">Add New Profile</div>
        <div className="profile-box pink">Unnamed Profiles</div>
        <div className="profile-box green">Paul Graham</div>
        <div className="profile-box green">Sam Altman</div>
        <div className="profile-box green">Bobak Tavangar</div>
        <div className="profile-box green">Raj Nakarja</div>
        <div className="profile-box green">Ben Heald</div>
      </div>
    </div>
  );
}

export default App;
